impl Solution {
    pub fn minimum_changes(s: String, k: i32) -> i32 {
        let n = s.len();
        let s: Vec<_> = s.chars().collect();
        let k = k as usize;

        // Function to calculate the cost to make a substring a semi-palindrome
        let mut cost = vec![vec![0; n]; n];
        for i in 0..n {
            for j in i..n {
                let mut changes = 0;
                let (mut left, mut right) = (i, j);
                while left < right {
                    if s[left] != s[right] {
                        changes += 1;
                    }
                    left += 1;
                    right -= 1;
                }
                cost[i][j] = changes;
            }
        }

        // dp[i][j] represents the minimum changes needed for the first i characters to form j semi-palindromes
        let mut dp = vec![vec![i32::MAX; k + 1]; n + 1];
        dp[0][0] = 0;
        for i in 1..=n {
            for j in 1..=k.min(i) {
                for m in j-1..i {
                    dp[i][j] = dp[i][j].min(dp[m][j-1] + cost[m][i-1]);
                }
            }
        }

        dp[n][k]
    }
}
